{"nodeType":"document","data":{},"content":[{"nodeType":"paragraph","content":[{"nodeType":"text","value":"Janine Ferrante is a Licensed Marriage and Family Therapist. She specializes in working with teens and adults with Anxiety, Depression, mood disorders, and women’s issues.
She offers a person-centered approach to assess her client’s unique needs and then draws upon evidence-based interventions such as CBT, DBT, mindfulness, psychodynamic, and family systems. With warmth and empathy, she seeks to form a strong therapeutic alliance with each of her clients. Janine earned her MA in Clinical Psychology from Pepperdine University.

","marks":[],"data":{}}],"data":{}},{"nodeType":"paragraph","content":[{"nodeType":"text","value":"Fun fact about Janine: she moved to Los Angeles from Boston over 20 years ago with her husband. They still return to visit family “back east” at least once a year with their 2 sons.","marks":[],"data":{}}],"data":{}}]}
